void printString(char string[]){
	int i;
	int len;
	len = strlen(string);
	for(i =0; i < len; i++)
	printf("%c", string[i]);
	printf("\n");	

}

	
void getLCS(char* String_A, char* String_B, int size_a, int size_b){
        unsigned long position;
	/*Create the suffix tree*/
	char stra[size_a];
	strcpy(stra, String_A);
	int m = strlen(stra);
	SUFFIX_TREE* tree = ST_CreateTree(stra, m);
	
	/*Strings to test*/
	char strb[size_b];
	strcpy(strb, String_B);
	
	char  substr[strlen(strb)]; 
	char prevsubstr[strlen(strb)];
	char longestCommonSubstring[strlen(strb)];
	
	int tempLCSlength=0;
	int totalSubstringLength=0;
	int numSubstrings=0;
	
	
	int i;
	int j;
	

	  for(i=0, j=1; j<strlen(strb)-i, i<strlen(strb)-1;){
	    
	    strncpy(substr, &strb[i], j)[j] = '\0';
		if(&substr[j-1] == NULL){
			return;
		}
	    printf("i = %d  Test Substring = ", i);
	    printString(substr);
		
	    if( ST_FindSubstring(tree, substr, strlen(substr)) == ST_ERROR){
		printString(substr);
		if(strlen(substr) > tempLCSlength){
			strcpy(longestCommonSubstring, prevsubstr);
			tempLCSlength = strlen(longestCommonSubstring);
			
		}

		totalSubstringLength+=strlen(substr)-1;
		numSubstrings++;
		i+=j-1;
		j=1;
	    }else{
		strcpy(prevsubstr, substr);
		j++;
	    }
	}
	

	printf("Longest Common Substring =");
	printString(longestCommonSubstring);
	printf("Number of substring = %d\n", numSubstrings);
	printf("Average Substring Length = %f\n", (double)totalSubstringLength / (double)numSubstrings);
}

